import {useContext } from "react";
import { Context } from "../Context/Context";
import Navbar from "../Navbar/Navbar";
import Card from "../Card/Card";

function Home (){

    const {dispatch} = useContext(Context);

    return(
        <>
            <Navbar/>
            <div style={{
                display:'flex',
                flexWrap:'wrap',
                margin:'20px',
            }} >
            <Card/>
            <Card/>
            <Card/>
            <Card/>     
            </div>      
        </>
    )
}
export default Home;
